import React, { useState } from "react";
import { furry } from "./Pet";
import "./Adopt.css";

export default function Adopt() {
  const [selectedPet, setSelectedPet] = useState(null);
  const [showForm, setShowForm] = useState(false);

  // Visit Form state
  const [form, setForm] = useState({
    name: "",
    address: "",
    city: "",
    phone: ""
  });

  // Handle opening modal (details)
  const handleCardClick = (pet) => {
    setSelectedPet(pet);
    setShowForm(false);
  };

  // Handle Schedule Visit button
  const handleScheduleClick = () => setShowForm(true);

  // Handle Form Inputs
  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Submit action (for now—just alert, or you can POST to backend)
  const handleSubmit = (e) => {
    e.preventDefault();
    alert(
      `Visit scheduled for ${selectedPet.name}!\nDetails:\nName: ${form.name}\nAddress: ${form.address}\nCity: ${form.city}\nPhone: ${form.phone}`
    );
    setSelectedPet(null);
    setForm({ name: "", address: "", city: "", phone: "" });
  };

  return (
    <div className="grid-container">
      <h2 className="grid-title">Meet Our Adorable Pets</h2>
      <div className="grid">
        {furry.map((pet, index) => (
          <div className="card" key={index}>
            <img
              src={pet.url}
              alt={pet.alt}
              className="image"
              style={{ cursor: "pointer" }}
              onClick={() => handleCardClick(pet)}
            />
            <h3 className="name">{pet.name}</h3>
            <p
              className="description"
              style={{ cursor: "pointer" }}
              onClick={() => handleCardClick(pet)}
            >
              {pet.description}
            </p>
          </div>
        ))}
      </div>

      {/* Pet Details Modal */}
      {selectedPet && (
        <div className="modal-bg">
          <div className="modal">
            {!showForm ? (
              <>
                <button
                  className="modal-close"
                  onClick={() => setSelectedPet(null)}
                >
                  &times;
                </button>
                <img src={selectedPet.url} alt={selectedPet.alt} className="image" />
                <h3 className="name">{selectedPet.name}</h3>
                <p className="description">{selectedPet.description}</p>
                <button className="adopt-btn" onClick={handleScheduleClick}>
                  Schedule a visit now!
                </button>
              </>
            ) : (
              <>
                <button
                  className="modal-close"
                  onClick={() => setSelectedPet(null)}
                >
                  &times;
                </button>
                <h3 className="name">{selectedPet.name}</h3>
                <form className="visit-form" onSubmit={handleSubmit}>
                  <input
                    name="name"
                    placeholder="Your Name"
                    value={form.name}
                    onChange={handleInputChange}
                    required
                  />
                  <input
                    name="address"
                    placeholder="Address"
                    value={form.address}
                    onChange={handleInputChange}
                    required
                  />
                  <input
                    name="city"
                    placeholder="City"
                    value={form.city}
                    onChange={handleInputChange}
                    required
                  />
                  <input
                    name="phone"
                    placeholder="Phone Number"
                    value={form.phone}
                    onChange={handleInputChange}
                    required
                  />
                  <button className="adopt-btn" type="submit">
                    Submit Visit Request
                  </button>
                </form>
              </>
            )}
          </div>
        </div>
      )}
    </div>
  );
}
